import React from "react";
import "./footer.css"

function Footer() {
    return (
        <footer className="footer">
            <div className="footer__container container_">
                <h1 className="footer__title">Minh</h1>

                <ul className="footer__list">

                </ul>
            </div>
        </footer>
    )
}

export default Footer;
